- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1CFor Line 16, the entries for $4000
    on 7/23/10 & $1000 on 7/28/10 received from the Bennett Election Committee Inc
    represent refunds of contributions previously made to Robert Bennett's campaign
    (Senate-R-UT) by our committee for the 2010 Convention & 2010 General respectively.
    \ For the 7/1/10 $200 contra disbursement reported on Line 21b of this report
    and transferred to Line 24, the full purpose of disbursement should be noted as:
    Independent Expenditure disseminated, see Line 24 item. This amount relates to
    an original $4,250.00 advance payment made to the National Association of Realtors
    for consulting services on 8/22/2008 and reported on Line 21b of the September
    2008 monthly report. Subsequently in 2008, we utilized $3,750.00 of this advanced
    payment as consulting services attributable to independent expenditures & reflected
    as negative amounts subtracted from Line 21b and transferred to Line 24.  $200.00
    of the original $4,250.00 is being utilized as consulting services attributable
    to independent expenditures & reflected on Line 24 in this period, with the full
    purpose of disbursement as: Transfer from Line 21b to Line 24 due to public dissemination
    of independent expenditure communication & attributed as consulting services on
    7/1/10 for Mike Thompson. For the 7/1/10 $3,500.00 contra disbursement for Amplify
    Public Affairs LLC reported on Line 21b of this report and transferred to Line
    24, the full purpose of disbursement should be noted as: Independent Expenditure
    disseminated, see Line 24 item.  For the $3,500 Amplify Public Affairs LLC payee
    entry reflected on Line 24, the full purpose of disbursement for each is: Transfer
    from Line 21b to Line 24 due to public dissemination of independent expenditure
    communication & attributed as website design/production/operation costs on 7/1/10
    for Mike Thompson.  For Line 21b of the August 2010 monthly report, the $7,000.00
    & $21,000.00  disbursements attributable to Amplify Public Affairs LLC, on 7/23/10
    & 7/27/10 respectively, represent advance website design costs for independent
    expenditures that were not publicly disseminated during this reporting period,
    but instead will be disseminated in future reporting periods. For Line 22 of this
    report, the disbursements to Indiana RPAC for $4,995.05 on 7/14/10 and Michigan
    RPAC for $1,542.00 on 7/29/10 represent refunds for transmissions of funds inadvertently
    sent in error by the state agents.  \n"
